X Lag is script I just finished making.
It lags by using 3 methods: Opening web pages, without waits. Bitmap loading, again, without waits. Computing random numbers with a 400th(?) of a second wait(Credits to Martin).
It moves the mouse randomly for fun(Credits to Ron)!
USE WITH CAUTION!!
